import React from 'react';

const Service = (props) => {
    const {image,id,name,price,time,description}=props.services;
    return (
       
            
        
        <div className='service pb-3'>
        
            <img src={image} alt="" />
            <h2>id:{id}</h2>
            <h2>Name:{name}</h2>
            <h2>Time:{time}</h2>
            <p>Description:{description}</p>
            <h2>Price:{price}</h2>
            <Lin to={`/booking/${id}`}>
            <button className='btn-primary'>Book:{name.toLowerCase()}</button>
            </Lin>
            
        </div>
        
    );
};

export default Service;
